import React, { Fragment } from 'react';
import MaterialTable from 'material-table'
import TableIcons from '../../common/materialicon'
import Locker from '../../../core/locker'


export default class LockerManagement extends React.Component {
    rBuildingIdInput = 0;
    rLevelIdInput = 0;
    rImeiInput = '';
    rLabelInput = '';
    lPage = [];
    bDatas = [];
    lDatas = [];
    cDatas = [];

    optionsTable = {
        search: false,
        showTitle: false,
        pageSize: 20,
        pageSizeOptions: [20],
    }


    columns  = [
        {
            title: 'Tòa nhà',
            field: '',
        },
        {
            title: 'Tầng',
            field: '',
        },
        {
            title: 'Thiết bị quản lý'
        },
        {
            title: 'Nhãn tủ',
            field: '',
        },
        
    ]
    constructor(props) {
        super(props);
        this.state = {
        };
    }

    componentDidMount() {
    }
    
    getDataFromServer = (query) => {
        return new Promise((resolve, reject) => {
            Locker.getLocker(0,0,'','',0,0,1)
            .then(value => {
                    console.log(value);            
                 })
        })
    }

    render() {
        return(
            <Fragment>
              LockerManagement
              <MaterialTable 
              columns = {this.columns}
              options = {this.optionsTable}
              data = {this.getDataFromServer}
              icons = {TableIcons}
              />

            </Fragment>
        )
    }
}
